package com.demo;


public class Slot {

	int slotId;
	String slot;
	
	public Slot() {
		// TODO Auto-generated constructor stub
	}

	public Slot(int slotId, String slot) {
		super();
		this.slotId = slotId;
		this.slot = slot;
	}

	public int getSlotId() {
		return slotId;
	}

	public void setSlotId(int slotId) {
		this.slotId = slotId;
	}

	public String getSlot() {
		return slot;
	}

	public void setSlot(String slot) {
		this.slot = slot;
	}
	
}

